import React, { useState } from 'react';
import {
  Typography,
  Button,
  TextField,
  Grid,
  Card,
  CardContent,
  CardActions,
  IconButton,
  Box,
} from '@mui/material';
import {
  Add as AddIcon,
  Edit as EditIcon,
  Delete as DeleteIcon,
} from '@mui/icons-material';
import PageContainer from '../../components/PageContainer';
import FormDialog from '../../components/FormDialog';

function Vehicles() {
  const [vehicles, setVehicles] = useState([
    { id: 1, name: 'Batmóvel', model: '2024', plate: 'BAT-0001', status: 'Ativo' },
    { id: 2, name: 'Batpod', model: '2024', plate: 'BAT-0002', status: 'Manutenção' },
  ]);
  const [openDialog, setOpenDialog] = useState(false);
  const [editingVehicle, setEditingVehicle] = useState(null);
  const [formData, setFormData] = useState({
    name: '',
    model: '',
    plate: '',
    status: '',
  });

  const handleOpenDialog = (vehicle = null) => {
    if (vehicle) {
      setEditingVehicle(vehicle);
      setFormData(vehicle);
    } else {
      setEditingVehicle(null);
      setFormData({ name: '', model: '', plate: '', status: '' });
    }
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
    setEditingVehicle(null);
  };

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (editingVehicle) {
      setVehicles(vehicles.map((v) => 
        v.id === editingVehicle.id ? { ...formData, id: v.id } : v
      ));
    } else {
      setVehicles([...vehicles, { ...formData, id: Date.now() }]);
    }
    handleCloseDialog();
  };

  const handleDelete = (id) => {
    if (window.confirm('Tem certeza que deseja excluir este veículo?')) {
      setVehicles(vehicles.filter((v) => v.id !== id));
    }
  };

  return (
    <PageContainer title="Veículos">
      <Box mb={3}>
        <Button
          variant="contained"
          startIcon={<AddIcon />}
          onClick={() => handleOpenDialog()}
        >
          Novo Veículo
        </Button>
      </Box>

      <Grid container spacing={3}>
        {vehicles.map((vehicle) => (
          <Grid item xs={12} sm={6} md={4} key={vehicle.id}>
            <Card>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  {vehicle.name}
                </Typography>
                <Typography color="textSecondary">
                  Modelo: {vehicle.model}
                </Typography>
                <Typography color="textSecondary">
                  Placa: {vehicle.plate}
                </Typography>
                <Typography color="textSecondary">
                  Status: {vehicle.status}
                </Typography>
              </CardContent>
              <CardActions>
                <IconButton
                  size="small"
                  onClick={() => handleOpenDialog(vehicle)}
                >
                  <EditIcon />
                </IconButton>
                <IconButton
                  size="small"
                  onClick={() => handleDelete(vehicle.id)}
                >
                  <DeleteIcon />
                </IconButton>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>

      <FormDialog
        open={openDialog}
        onClose={handleCloseDialog}
        title={editingVehicle ? "Editar Veículo" : "Novo Veículo"}
        onSubmit={handleSubmit}
      >
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <TextField
              name="name"
              label="Nome"
              fullWidth
              value={formData.name}
              onChange={handleChange}
              required
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              name="model"
              label="Modelo"
              fullWidth
              value={formData.model}
              onChange={handleChange}
              required
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              name="plate"
              label="Placa"
              fullWidth
              value={formData.plate}
              onChange={handleChange}
              required
            />
          </Grid>
          <Grid item xs={12}>
            <TextField
              name="status"
              label="Status"
              fullWidth
              value={formData.status}
              onChange={handleChange}
              required
            />
          </Grid>
        </Grid>
      </FormDialog>
    </PageContainer>
  );
}

export default Vehicles;
